let profileButtonsContainer = {
  display: "flex", 
  margin: "10px 0 5px 10px"
};

let profileButton = {
  backgroundColor: "#4382BC",
  width: "98px",
  height: "27px",
  marginRight: "2px",
  textAlign: "center",
  paddingTop: "3px",
  cursor: "pointer",
  userSelect: "none",
  fontWeight: "bold",
  color: "white",
};

let profileButtonHighlighted = {
  ...profileButton,
  width: "94px",
  height: "25px",
  border: "2px solid #07405b",
  paddingTop: "1px",
};

export {
  profileButtonsContainer,
  profileButton,
  profileButtonHighlighted
};
